import React, { useState, useEffect } from 'react';
import DietJournalEntry from './DietJournalEntry';

function DietJournal() {
    const [entries, setEntries] = useState(Array(10).fill({ meal: '', calories: '', category: '' }));
    const [predefinedMeals, setPredefinedMeals] = useState([]);
    const [suggestions, setSuggestions] = useState([]);

    useEffect(() => {
        // Fetch predefined meals from your API endpoint
        fetch('your_api_endpoint')
            .then(response => response.json())
            .then(data => {
                // Assuming data is an array of meal names
                setPredefinedMeals(data);
            })
            .catch(error => console.error('Error fetching predefined meals:', error));
    }, []);

    const handleEntryChange = (index, event) => {
        const { name, value } = event.target;
        const newEntries = [...entries];
        newEntries[index][name] = value;
        setEntries(newEntries);
        if (name === 'meal') {
            // Filter suggestions based on user input
            const filteredSuggestions = predefinedMeals.filter(
                meal => meal.toLowerCase().includes(value.toLowerCase())
            );
            setSuggestions(filteredSuggestions);
        }
    };

    const handleSuggestionClick = (index, suggestion) => {
        const newEntries = [...entries];
        newEntries[index]['meal'] = suggestion;
        setEntries(newEntries);
        setSuggestions([]); // Clear suggestions
    };

    return (
        <li>
            <h5>Diet Journal</h5>

            <div style={{ maxHeight: '200px', overflowY: 'auto' }}>
                {entries.map((entry, index) => (
                    <div key={index} style={{ marginBottom: '10px' }}>
                        <input
                            type="text"
                            name="meal"
                            value={entry.meal}
                            onChange={(event) => handleEntryChange(index, event)}
                            placeholder="Meal"
                            style={{ marginRight: '10px', width: '200px' }}
                        />
                        <input
                            type="text"
                            name="calories"
                            value={entry.calories}
                            onChange={(event) => handleEntryChange(index, event)}
                            placeholder="Calories"
                            style={{ marginRight: '10px', width: '100px' }}
                        />
                        <input
                            type="text"
                            name="category"
                            value={entry.category}
                            onChange={(event) => handleEntryChange(index, event)}
                            placeholder="Category"
                            style={{ width: '100px' }}
                        />
                        {suggestions.length > 0 && (
                            <ul style={{ listStyle: 'none', paddingLeft: 0 }}>
                                {suggestions.map((suggestion, idx) => (
                                    <li key={idx} onClick={() => handleSuggestionClick(index, suggestion)}>
                                        {suggestion}
                                    </li>
                                ))}
                            </ul>
                        )}
                    </div>
                ))}
            </div>
        </li>
    );
}

export default DietJournal;
